	add("grexit", "{\"term\":\"grexit\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|Greek|exit|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The potential withdrawal of Greece from the Eurozone\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, \u0027Words You Should Know: 2013\u0027, F+W Media, [https://books.google.com/books?id\u003d7BprQ9Z9OUIC\u0026amp;pg\u003dPA100\u0026amp;dq\u003d%22grexit%2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage page 100\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Throughout 2012, economists speculated on the likelihood of the \u0027\u0027Grexit\u0027\u0027 by 2013\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027, Alison McDonnell, \u0026quot;Solidarity, Flexibility, and the Euro-Crisis: Where do Principles Fit In?\u0026quot; in \u0027The EU After Lisbon\u0027, [https://books.google.com/books?id\u003d6APnAwAAQBAJ\u0026amp;lpg\u003dPA72\u0026amp;dq\u003d%22grexit%22\u0026amp;pg\u003dPA7\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22grexit%22\u0026amp;f\u003dfalse page 72\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Around the middle of 2012, speculation was rife about the likelihood of the so-called \u0027\u0027Grexit\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027, Jonathan Story, \u0026quot;The Euro Crisis and German Primacy\u0026quot; in \u0027The Eurozone Crisis and the Future of Europe\u0027, [https://books.google.com/books?id\u003d68tCBAAAQBAJ\u0026amp;lpg\u003dPA117\u0026amp;dq\u003d%22grexit%22\u0026amp;pg\u003dPA11\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22grexit%22\u0026amp;f\u003dfalse page 117\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Grexit\u0027\u0027, in short, would have left the way open to German monetary independence\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027, Gillian Tett, \u0026quot;Beware hidden costs as banks eye ‘Grexit’\u0026quot;, [https://books.google.com/books?id\u003dU3Rsdjkp1K0C\u0026amp;lpg\u003dPT30\u0026amp;dq\u003d%22grexit%22\u0026amp;pg\u003dPT3\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22grexit%22\u0026amp;f\u003dfalse\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The bankers, however, were alarmingly precise: amid all the speculation about \u0027\u0027Grexit\u0027\u0027, they told me, banks are increasingly reordering their European exposure along national lines\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2015\u0027\u0027, Stavros Mavroudeas, \u0027Greek Capitalism in Crisis: Marxist analyses\u0027, [https://books.google.com/books?id\u003ddiAWBAAAQBAJ\u0026amp;lpg\u003dPA91\u0026amp;dq\u003d%22grexit%22\u0026amp;pg\u003dPA9\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22grexit%22\u0026amp;f\u003dfalse page 91\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Regarding the relationship with the EU after the \u0027\u0027Grexit\u0027\u0027 he remains agnostic\", \"priority\":16}]}, \"synonyms\":{}}");

	add("greyback", "{\"term\":\"greyback\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|grey|back|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A Confederate soldier during the US Civil War (because of the grey uniforms\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1871\u0027\u0027, Mary Stephens Robinson, \u0027A household story of the American conflict\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"to resist the farther advance of the \u0027\u0027greybacks\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1988\u0027\u0027, James McPherson, \u0027Battle Cry of Freedom\u0027, Oxford 2004, p. 739\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Sheridan managed to keep the \u0027\u0027graybacks\u0027\u0027 at bay while he tore up the railroad, but he abandoned the plan to link up with Hunter, and the southerners soon repaired the railroad\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A louse\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1886\u0027\u0027, \u0027Central Reporter: Cases, Courts of Last Resort\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"It is alleged by the defendant that there were scabs and \u0027\u0027greybacks\u0027\u0027 in it, and that it did not come up to the quality of No. 1 slate as contracted for\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A local name for various grey birds\", \"priority\":9}]}, \"synonyms\":{}}");

	add("greyhound", "{\"term\":\"greyhound\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"Icelandic\", \"old norse\"], \"text\":\"Old english (ca. 450-1100) {{m|ang|grīġhund}}, from a cognate or borrowing of Old norse {{m|non|grøy||bitch}} whence Icelandic {{m|is|grey}} (thus not related to the colour \u0027grey\u0027 , plus \u0027hund\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A lean breed of dog used in hunting and racing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A highball cocktail of vodka and grapefruit juice\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A swift steamer, especially an ocean steamer\", \"priority\":3}]}, \"synonyms\":{}}");

	add("greylag", "{\"term\":\"greylag\", \"etymology\":{\"influencers\":[{}], \"languages\":[], \"text\":\"From \u0027grey\u0027 (colour) + \u0027lag\u0027 (old name for a goose, derived from the call used to move such animals along)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A large grey European goose, \u0027Anser anser\u0027, with pink legs and dull orange beak\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1967\u0027\u0027, Jeffery G. Harrison, \u0027A Wealth of Wildfowl\u0027, [https://books.google.com.au/books?id\u003dPq8vAAAAYAAJ\u0026amp;q\u003d%22greylags%22\u0026amp;dq\u003d%22greylags%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d5dVaVaDANdjv8gWPi4DYAw\u0026amp;ved\u003d0CJUBEOgBMBc page 150\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Since the war, migrant \u0027\u0027greylags\u0027\u0027 have virtually deserted the Duddon estuary, so it is a source of great satisfaction that the WAGBI greylags have taken to roosting on the sands in mid-winter, flighting to and from the reserve\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, M. Owen, \u0027Greylag Goose\u0027, Peter Lack (editor), \u0027The Atlas of Wintering Birds in Britain and Ireland\u0027, [https://books.google.com.au/books?id\u003dblWiD_QEYkMC\u0026amp;pg\u003dPA74\u0026amp;dq\u003d%22greylags%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d5dVaVaDANdjv8gWPi4DYAw\u0026amp;ved\u003d0CDIQ6AEwB\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22greylags%22\u0026amp;f\u003dfalse page 74\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Greylags\u0027\u0027 used to concentrate on British estuaries, eating roots of rushes and sedges, as they do in other parts of their range\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Adam Watson, Ian Francis, \u0027Birds in North-East Scotland Then and Now\u0027, [https://books.google.com.au/books?id\u003dUnYwmHzX1goC\u0026amp;pg\u003dPA11\u0026amp;dq\u003d%22greylags%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d5dVaVaDANdjv8gWPi4DYAw\u0026amp;ved\u003d0CLYBEOgBMB\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22greylags%22\u0026amp;f\u003dfalse page 11\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Earlier, 250 more had flown to Rattray beach, nearly all pinkfeet although I saw four \u0027\u0027greylags\u0027\u0027 and heard others\", \"priority\":9}]}, \"synonyms\":{}}");

