	add("greywacke", "{\"term\":\"greywacke\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Anglicised form of \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A hard dark sandstone with poorly sorted angular grains of quartz, feldspar, and small rock fragments in a compact, clay-fine matrix\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, \u0027The Earth\u0027, Folio Society 2011, p. 177\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Endless bleak, rounded hills composed of shales and ribs of tough ‘\u0027\u0027greywackes\u0027\u0027’ make up the Southern Uplands – all of such rocks were originally deposited under marine conditions\", \"priority\":3}]}, \"synonyms\":{}}");

